import { backendAPI } from '../../api';
export class BetaCodeServiceImplementation {
  async create() {
    const betaCode = await backendAPI.post('beta-codes');
    return betaCode.data;
  }

  async getAll() {
    const betaCodes = await backendAPI.get('beta-codes');
    return betaCodes.data;
  }

  async delete(code) {
    await backendAPI.delete(`beta-codes/${code}`);
  }

}
